import React from 'react'

const Header = () => {
  return (
    <div className='mt-8'>
        <h1 className='text-3xl font-bold'>Please fill in the form</h1>
        <p className='text-sm font-semibold'>We would like to mention that the results you obtain from this form only indicates a risk of having this disease and a full medical checkup is required for proper diagnosis of the condition.</p>
    </div>
  )
}

export default Header
